import React from "react";

import './WelcomePage.css';
import './StartBtn';
import Button from "./StartBtn";

const WelcomePage = props => {
    const signUp = async event => {
        event.preventDefault();
        try {
            //const response = await fetch('http://localhost:5000/api/uploadFile/', {
            const response = await fetch('http://localhost:5000/api/users/start', {
              method: 'POST',
              headers: {
                'Content-Type': 'application/json'
              },
              body: JSON.stringify({
                userId:1
              })
            });
            //const  responsedata = await response.json();
            const responsedata = await response.json();
            if (!response.ok) {
                throw new Error(responsedata.message);
              }
            //console.log(responsedata);
    
          }catch(err){
            console.log(err);
            //setError(err.message  || 'Something went wrong');
          }
    };

    return (
        <React.Fragment>
            <div className="welcome-page">
                <h2>Schedule Generator</h2>
                <p>
                    Welcome to the Ant System Generate Schedule Website. Click "start" button to start generating schedule
                </p>
                <Button></Button>
            </div>
        </React.Fragment>
    );
};

export default WelcomePage;
